('2370','18','7898','Villa Jikki',Null,'Komfortables Einfamilienhaus in Sa Torre mit 5 Schlafzimmern','33360','Das Einfamilienhaus wurde 2007 auf einem ca 1.000m² großen Grundstück erstellt. Es bietet auf 340m² Wohnfläche , verteilt auf 2 Wohnebenen, ein Wohn-Esszimmer, offenen Einbauküche, Gäste WC, 5 Schlafzimmer und 4 Badezimmer. Im sehr gepflegten Garten befindet sich noch ein Pool und ein Barbecue.Zur Ausstattung gehören eine Klimaanlage w/k, Ölzentralheizung(Radiatoren) und Doppelglasfenster. Vom 1. OG aus hat man einen sehr schönen Blick in die Bucht von Palma de Mallorca. \r\n\r\n','33361','980000','106','2015-08-31 11:47:50','106','2015-08-31 11:48:40',Null,'2459','163','1154',1,'1','0',Null,Null,Null,'33362',Null,'0','0','0',Null,'2015-08-31 11:54:03',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33363',Null,'33364',Null,'33365',Null,'33366','629758536','33367','0',0,'4');
